INSERT INTO `t_product` VALUES ('39', 'zscatLte分布式框架', 'spring', '<p style=\"margin-bottom: 15px; orphans: 2; white-space: normal; widows: 2; box-sizing: inherit; line-height: 25px; text-align: justify; word-break: break-word; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; font-size: 15px; background-color: rgb(250, 250, 250); margin-top: 0px !important;\">zscatLte是一个轻量级权限管理系统，其核心设计目标是开发迅速、学习简单、轻量级、易扩展。<br style=\"box-sizing: inherit;\"/>使用zscatLte搭建项目，只需编写30%左右代码，其余的代码交给系统自动生成。<br style=\"box-sizing: inherit;\"/>一个月的工作量，一周就能完成，剩余的时间可以陪家人、朋友、撩妹、钓凯子等，从此踏入高富帅、白富美行业。</p><p style=\"margin-top: 0px; margin-bottom: 15px; orphans: 2; white-space: normal; widows: 2; box-sizing: inherit; line-height: 25px; text-align: justify; word-break: break-word; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; font-size: 15px; background-color: rgb(250, 250, 250);\"><strong style=\"box-sizing: inherit;\">具有如下特点</strong></p><ul class=\"task-list\" style=\"orphans: 2; white-space: normal; widows: 2; box-sizing: inherit; font-size: 14px; line-height: 24px; margin: 0px 0px 15px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; background-color: rgb(250, 250, 250);\"><li>轻量级的权限系统，只涉及Spring、Shiro、Mybatis后端框架，降低学习使用成本</li><li>友好的代码结构及注释，便于阅读及二次开发</li><li>支持HTML、JSP、Velocity、Freemarker等视图，零技术门槛</li><li>灵活的权限控制，可控制到页面或按钮，满足绝大部分的权限需求(如需控制到按钮级别，需使用Shiro标签，控制按钮的显示或隐藏)</li><li>页面交互使用Vue2.x，极大的提高了开发效率</li><li>完善的代码生成机制，可在线生成entity、xml、dao、service、page、js代码，减少70%以上的开发任务</li><li>引入quartz定时任务，可动态完成任务的添加、修改、删除、暂停、恢复及日志查看等功能</li><li>引入路由机制，刷新页面会停留在当前页</li></ul><p><img src=\"/static/ueditor/jsp/upload1/20161227/1482833332927.png\" style=\"float:none;\" title=\"blog.png\"/></p><p><img src=\"/static/ueditor/jsp/upload1/20161227/1482833337146.png\" sty