INSERT INTO `t_product` VALUES ('41', 'ssh后台框架_activiy5', 'ssh', '<h3 style=\"box-sizing: inherit; font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; line-height: 1.33em; margin: 20px 0px 10px; padding: 0px; font-size: 18px; -webkit-font-smoothing: antialiased; cursor: text; position: relative; color: rgba(0, 0, 0, 0.8); white-space: normal; background-color: rgb(250, 250, 250);\">ommon</h3><ul class=\"task-list\" style=\"box-sizing: inherit; font-size: 14px; line-height: 24px; margin: 0px 0px 15px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; white-space: normal; background-color: rgb(250, 250, 250);\"><li>泛型封装dao、service、controller基类，包含分页，查询条件封装，从而达到快速crud操作(参考<a href=\"https://github.com/springside\" target=\"_blank\" style=\"box-sizing: inherit; color: rgb(65, 131, 196); text-decoration: none; background-color: transparent; cursor: pointer !important; word-wrap: break-word; margin-top: 0px; margin-bottom: 0px; background-position: initial initial; background-repeat: initial initial;\">springside4</a>&quot;)</li><li>简易代码生成器,增加字段配置功能、生成页面功能，实现增删查改不需要写一句代码(参考<a href=\"https://github.com/thinkgem/jeesite\" target=\"_blank\" style=\"box-sizing: inherit; color: rgb(65, 131, 196); text-decoration: none; background-color: transparent; cursor: pointer !important; word-wrap: break-word; margin-top: 0px; margin-bottom: 0px; background-position: initial initial; background-repeat: initial initial;\">jeesite</a>)</li><li>ehcache缓存</li><li>springmvc 整合hibernate validater 进行后端数据验证</li></ul><h3 style=\"box-sizing: inherit; font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; line-height: 1.33em; margin: 20px 0px 10px; padding: 0px; font-size: 18px; -webkit-font-smoothing: antialiased; cursor: text; position: relative; color: rgba(0, 0, 0, 0.8); white-space: normal; background-color: rgb(250, 250, 250);\"><a class=\"anchor\" id=\"系统权限管理_6\" href=\"http://git.oschina.net/rguess/thinker#系统权限管理_6\" style=\"box-sizing: inherit; color: rgb(65, 131, 196); text-decoration: none; background-color: transparent; cursor: pointer; word-wrap: break-word; display: block; padding-left: 30px; margin-left: -20px; position: absolute; top: 0px; left: 0px; bottom: 0px; outline: none; background-position: initial initial; background-repeat: initial initial;\"></a>系统权限管理</h3><ul class=\"task-list\" style=\"box-sizing: inherit; font-size: 14px; line-height: 24px; margin: 0px 0px 15px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; white-space: normal; background-color: rgb(250, 250, 250);\"><li>系统管理——包含用户、角色、权限、资源、菜单管理</li><li>权限管理——使用框架apache shiro进行系统认证、授权操作</li><ul class=\"task-list\" style=\"box-sizing: inherit; margin: 0px; padding-left: 30px;\"><li>系统认证、授权操作</li><li>按钮粒度的权限控制</li><li>并发登录人数控制</li><li>后端使用注解进行方法级别的权限控制</li></ul><li>系统登录,操作日志记录,查询,分析</li></ul><h3 style=\"box-sizing: inherit; font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; line-height: 1.33em; margin: 20px 0px 10px; padding: 0px; font-size: 18px; -webkit-font-smoothing: antialiased; cursor: text; position: relative; color: rgba(0, 0, 0, 0.8); white-space: normal; background-color: rgb(250, 250, 250);\"><a class=\"anchor\" id=\"oa工作流程_7\" href=\"http://git.oschina.net/rguess/thinker#oa工作流程_7\" style=\"box-sizing: inherit; color: rgb(65, 131, 196); text-decoration: none; background-color: transparent; cursor: pointer; word-wrap: break-word; display: block; padding-left: 30px; margin-left: -20px; position: absolute; top: 0px; left: 0px; bottom: 0px; outline: none; background-position: initial initial; background-repeat: initial initial;\"></a>OA工作流程</h3><ul class=\"task-list\" style=\"box-sizing: inherit; font-size: 14px; line-height: 24px; margin: 0px 0px 15px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; white-space: normal; background-color: rgb(250, 250, 250);\"><li>集成activiti(工作流引擎)</li><ul class=\"task-list\" style=\"box-sizing: inherit; margin: 0px; padding-left: 30px;\"><li>整合spring</li><li>工作流引擎并完成工作流通用基类、常用工具类</li><li>通用待办,已办,我的流程等常用查询</li><li>定义业务开发需实现的接口</li><li>流程部署</li><li>请假流程例子</li><li>自由工作流设计例子</li></ul></ul><h3 style=\"box-sizing: inherit; font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; line-height: 1.33em; margin: 20px 0px 10px; padding: 0px; font-size: 18px; -webkit-font-smoothing: antialiased; cursor: text; position: relative; color: rgba(0, 0, 0, 0.8); white-space: normal; background-color: rgb(250, 250, 250);\"><a class=\"anchor\" id=\"内容管理_8\" href=\"http://git.oschina.net/rguess/thinker#内容管理_8\" style=\"box-sizing: inherit; color: rgb(65, 131, 196); text-decoration: none; background-color: transparent; cursor: pointer; word-wrap: break-word; display: block; padding-left: 30px; margin-left: -20px; position: absolute; top: 0px; left: 0px; bottom: 0px; outline: none; background-position: initial initial; background-repeat: initial initial;\"></a>内容管理</h3><ul class=\"task-list\" style=\"box-sizing: inherit; font-size: 14px; line-height: 24px; margin: 0px 0px 15px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; white-space: normal; background-color: rgb(250, 250, 250);\"><li>实现栏目，文章，系统静态资源的管理</li><li>实现上传word发表文章</li><li>实现ueditor富文本方式发表文章</li><li>aop+freemarker+线程实现首页静态化</li><li>实现多个站点的管理</li><li>基于该cms的个人博客网站</li></ul><h3 style=\"box-sizing: inherit; font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; line-height: 1.33em; margin: 20px 0px 10px; padding: 0px; font-size: 18px; -webkit-font-smoothing: antialiased; cursor: text; position: relative; color: rgba(0, 0, 0, 0.8); white-space: normal; background-color: rgb(250, 250, 250);\"><a class=\"anchor\" id=\"utils_9\" href=\"http://git.oschina.net/rguess/thinker#utils_9\" style=\"box-sizing: inherit; color: rgb(65, 131, 196); text-decoration: none; background-color: transparent; cursor: pointer; word-wrap: break-word; display: block; padding-left: 30px; margin-left: -20px; position: absolute; top: 0px; left: 0px; bottom: 0px; outline: none; background-position: initial initial; background-repeat: initial initial;\"></a>utils</h3><ul class=\"task-list\" style=\"box-sizing: inherit; font-size: 14px; line-height: 24px; margin: 0px 0px 15px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; white-space: normal; background-color: rgb(250, 250, 250);\"><li>开发中常用工具类整理</li><ul class=\"task-list\" style=\"box-sizing: inherit; margin: 0px; padding-left: 30px;\"><li>基于apache poi的通用导出excel工具类</li><li>各种类型相互转化工具类</li><li>Http与Servlet工具类</li><li>常用日期处理工具类</li><li>各种编码,解码,加密等工作类</li><li>反射操作封装</li><li>文件操作</li><li>WordToHtml</li><li>spring注解方式实现定时任务调度，实现mysql数据备份</li><li>...</li></ul><li>整理了丰富多样的js、jquery插件</li><ul class=\"task-list\" style=\"box-sizing: inherit; margin: 0px; padding-left: 30px;\"><li>bootstrap</li><li>jquery validation、修改验证后显示以适应bootstrap，显得更加美观、添加常用验证</li><li>自定义的js分页插件(配合bootstrap-paginator)</li><li>ztree(jquery 树插件)</li><li>datetimepicker(日历控件)</li><li>gritter(提示框)</li><li>jquery-slimscroll(定义局部元素滚动)</li><li>jquery-treegrid(树插件能更好的与bootstrap table融合以展示数据)</li><li>bootstrap-tree(简易的树插件)</li><li>chosen-bootstrap(下拉框选择控件)</li><li>font-awesome(字体)</li><li>uniform(表单美化)</li><li>jquery blockUI(遮罩层)</li><li>ueditor(富文本编辑器)</li><li>bootstrap-fileupload</li><li>jquery fileupload多文件上传带进度条</li><li>....</li></ul></ul><h3 style=\"box-sizing: inherit; font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; line-height: 1.33em; margin: 20px 0px 10px; padding: 0px; font-size: 18px; -webkit-font-smoothing: antialiased; cursor: text; position: relative; color: rgba(0, 0, 0, 0.8); white-space: normal; background-color: rgb(250, 250, 250);\"><a class=\"anchor\" id=\"others_10\" href=\"http://git.oschina.net/rguess/thinker#others_10\" style=\"box-sizing: inherit; color: rgb(65, 131, 196); text-decoration: none; background-color: transparent; cursor: pointer; word-wrap: break-word; display: block; padding-left: 30px; margin-left: -20px; position: absolute; top: 0px; left: 0px; bottom: 0px; outline: none; background-position: initial initial; background-repeat: initial initial;\"></a>others</h3><ul class=\"task-list\" style=\"box-sizing: inherit; font-size: 14px; line-height: 24px; margin: 0px 0px 15px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; white-space: normal; background-color: rgb(250, 250, 250);\"><li>集成jsper report动态报表工具(未完成)</li><li>jpush消息推送</li></ul><p><img src=\"/static/ueditor/jsp/upload1/20161227/1482833523239.png\" style=\"float:none;\" title=\"cms.png\"/></p><p><img src=\"/static/ueditor/jsp/upload1/20161227/1482833525442.png\" style=\"float:none;\" title=\"liuc2.png\"/></p><p><img src=\"/static/ueditor/jsp/upload1/20161227/1482833517232.png\" style=\"float:none;\" title=\"menu.png\"/></p><p><img src=\"/static/ueditor/jsp/upload1/20161227/1482833524270.png\" style=\"float:none;\" title=\"role1.png\"/></p><p><img src=\"/static/ueditor/jsp/upload1/20161227/1482833524459.png\" style=\"float:none;\" title=\"流程.png\"/></p><p><br/></p>,', 'ommon泛型封装dao、service、controller基类，包含分页，查询条件封装，从而达到快速crud操作(参考springside4\")简易代码生成器,增加字段配置功能、生成页面功能，实现增删查改不需要写一句代码(参考jeesite)ehcache缓存springmvc 整合hibernate v', '31', '10', 'home1.png', '框架', '247', null, '50', '/static/ueditor/jsp/upload1/20161227/1482833523239.png,/static/uedi