INSERT INTO `t_product` VALUES ('43', 'jeesite后台框架', '', '<p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 15px; line-height: 25px; text-align: justify; word-break: break-word; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; font-size: 15px; white-space: normal; background-color: rgb(250, 250, 250);\">1、后端</p><ul class=\"task-list\" style=\"box-sizing: inherit; font-size: 14px; line-height: 24px; margin: 0px 0px 15px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; white-space: normal; background-color: rgb(250, 250, 250);\"><li>核心框架：Spring Framework 4.1</li><li>安全框架：Apache Shiro 1.2</li><li>视图框架：Spring MVC 4.1</li><li>服务端验证：Hibernate Validator 5.2</li><li>布局框架：SiteMesh 2.4</li><li>工作流引擎：Activiti 5.21</li><li>任务调度：Spring Task 4.1</li><li>持久层框架：MyBatis 3.2</li><li>数据库连接池：Alibaba Druid 1.0</li><li>缓存框架：Ehcache 2.6、Redis</li><li>日志管理：SLF4J 1.7、Log4j</li><li>工具类：Apache Commons、Jackson 2.2、Xstream 1.4、Dozer 5.3、POI 3.9</li></ul><p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 15px; line-height: 25px; text-align: justify; word-break: break-word; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; font-size: 15px; white-space: normal; background-color: rgb(250, 250, 250);\">2、前端</p><ul class=\"task-list\" style=\"box-sizing: inherit; font-size: 14px; line-height: 24px; margin: 0px 0px 15px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; white-space: normal; background-color: rgb(250, 250, 250);\"><li>JS框架：jQuery 1.9。</li><li>CSS框架：Twitter Bootstrap 2.3.1（稳定是后台，UI方面根据需求自己升级改造吧）。</li><li>客户端验证：JQuery Validation Plugin 1.11。</li><li>富文本在线编辑：CKEditor</li><li>在线文件管理：CKFinder</li><li>动态页签：Jerichotab</li><li>手机端框架：Jingle</li><li>数据表格：jqGrid</li><li>对话框：jQuery jBox</li><li>下拉选择框：jQuery Select2</li><li>树结构控件：jQuery zTree</li><li>日期控件： My97DatePicker</li></ul><p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 15px; line-height: 25px; text-align: justify; word-break: break-word; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; font-size: 15px; white-space: normal; background-color: rgb(250, 250, 250);\">4、平台</p><ul class=\"task-list\" style=\"box-sizing: inherit; font-size: 14px; line-height: 24px; margin: 0px 0px 15px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, Arial, Helvetica, &#39;Microsoft YaHei&#39;, sans-serif; white-space: normal; background-color: rgb(250, 250, 250);\"><li>服务器中间件：在Java EE 5规范（Servlet 2.5、JSP 2.1）下开发，支持应用服务器中间件 有Tomcat 6+、Jboss 7+、WebLogic 10+、WebSphere 8+。</li><li>数据库支持：目前仅提供MySql和Oracle数据库的支持，但不限于数据库，平台留有其它数据库支持接口， 你可以很方便的更改为其它数据库，如：SqlServer 2008、MySql 5.5、H2等</li><li>开发环境：Java、Eclipse Java EE 4.3、Maven 3.1、Git</li></ul><p><br/></p>,', '1、后端核心框架：Spring Framework 4.1安全框架：Apache Shiro 1.2视图框架：Spring MVC 4.1服务端验证：Hibernate Validator 5.2布局框架：SiteMesh 2.4工作流引擎：Activiti 5.21任务调度：Spring Task 4.1持', '21', '10', 'zscat.png', '框架', '247', null, '', '', '34', '2016-12-27 18:21:25', '0', '0', '0', null);
